package tmp;

public class Main {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int [][] tab = new int [1000][4];
	    for (int w = 0; w < tab.length; w++) {
	        for (int k = 0; k < tab[w].length; k++) {

	            System.out.print((tab[w][k]) + ", ");
	        }
	        System.out.println("\n");
	    }
	}
}
